        print('hi')
        n = len(A)
        count  = 0
        for i in range(n):

            if (
                A[i] == 'A' or A[i] == 'E' or A[i] == 'O' or A[i] == 'U' or A[i] == 'I' or
                A[i] == 'a' or A[i] == 'e' or A[i] == 'i' or A[i] =='o' or A[i] == 'u' 
                ) :

                print(((n-1)-i)+1)
                count += ((n-1)-i)+1
        
        return count


